import css from "./Navbar.module.css"

const Navbar = () => {
  return (
    <nav className={css.navbar}>
      <div>
        <a href="Messages">Messages</a>
      </div>
      <div>
        <a href="Profile">Profile</a>
      </div>
      <a href="Music">Music</a>
      <div>
        <a href="Settings">Settings</a>
      </div>
    </nav>
  );
}

export default Navbar;
